from typing import List


class Solution:
    def returnRemainder(self, num1, num2=2):
            return num1 % num2

    def hasGroupsSizeX(self, deck: List[int]) -> bool:
        if len(deck) < 2:
            return False
        dict = {}
        for i, num in enumerate(deck):
            if num in dict:
                dict[num] = dict[num] + 1
            else:
                dict[num] = 1
        print(dict)
        # x = None
        tupleData = dict.items()
        minValue = min(tupleData, key=lambda t: t[1])
        minValue = minValue[1]
        if minValue < 2:
            return False
        flag = False
        for iter in range(2, minValue + 1):
            for key, value in tupleData:
                if (self.returnRemainder(value, iter) == 0):
                    flag = True
                else:
                    flag = False
                    break
            if flag is True:
                return True
        return flag

